import React from "react";
import ProjectCard from "../components/ProjectCard";
import AliceCarousel from 'react-alice-carousel';
import 'react-alice-carousel/lib/alice-carousel.css';
import Header from "../components/Header";
import "./Projects.css"
import Content from "../components/Content";
import simplyWeather from "../imgs/simplyweather.svg"

export default function Projects() {
    const responsive = {
        0: { items: 1 },
        568: { items: 2 },
        1024: { items: 3 },
    };

    const itemsLength = Array.from({ length: 5 });

const items = itemsLength.map((item, index) => {
    const style = { width: 150 + index * 100 };
    return (<div className="item" style={style}>{index + 1}</div>);
});

    return (
        <>
            <Header title={"Projects"} caption={"These are some of the projects that I've completed over the years.  Be sure to click through each one to get more info, view the final product, or view the code."} />
            <Content>
                <AliceCarousel autoWidth infinite mouseTracking items={items} />
            </Content>
        </>
    )
}
